  "source": "// SPDX-License-Identifier: MIT\r\npragma solidity ^0.8.0;\r\n\r\ncontract VNF {\r\n    address public owner;\r\n\r\n    enum Role { Developer, Tester, Reviewer, Verifier, BadgingAuthority }\r\n\r\n    struct DeveloperInfo {\r\n        string id;\r\n        string name;\r\n        address userAddress;\r\n        string ipfsHash;\r\n    }\r\n\r\n    struct TesterInfo {\r\n        string id;\r\n        string name;\r\n        address userAddress;\r\n        string ipfsHash;\r\n        string result;\r\n    }\r\n\r\n    struct ReviewerInfo {\r\n        string id;\r\n        string name;\r\n        address userAddress;\r\n        string ipfsHash;\r\n        string result;\r\n    }\r\n\r\n    struct VerifierInfo {\r\n        string id;\r\n        string name;\r\n        address userAddress;\r\n        string ipfsHash;\r\n        string result;\r\n    }\r\n\r\n    struct BadgingAuthorityInfo {\r\n        string id;\r\n        string name;\r\n        address userAddress;\r\n        string ipfsHash;\r\n    }\r\n\r\n    mapping(address => DeveloperInfo) public developers;\r\n    mapping(address => TesterInfo) public testers;\r\n    mapping(address => ReviewerInfo) public reviewers;\r\n    mapping(address => VerifierInfo) public verifiers;\r\n    mapping(address => BadgingAuthorityInfo) public badgingAuthorities;\r\n\r\n    mapping(Role => address[]) public roleToAddresses;\r\n\r\n    modifier onlyOwner() {\r\n        require(msg.sender == owner, \"Only the owner can call this function\");\r\n        _;\r\n    }\r\n\r\n   modifier onlyRole(Role _role) {\r\n    require(_role == Role.Developer || developers[msg.sender].userAddress != address(0), \"Insufficient role permissions\");\r\n    _;\r\n}\r\n\r\n    event UserAdded(Role role, address indexed user, string id, string name, string ipfsHash, string result);\r\n    event RoleListUpdated(Role role, address[] addresses);\r\n\r\n    constructor() {\r\n        owner = msg.sender;\r\n    }\r\n\r\n    function addDeveloper(string memory _id, string memory _name, address _userAddress, string memory _ipfsHash) external onlyOwner {\r\n        require(bytes(developers[_userAddress].id).length == 0, \"Developer already exists\");\r\n\r\n        DeveloperInfo memory newDeveloper = DeveloperInfo({\r\n            id: _id,\r\n            name: _name,\r\n            userAddress: _userAddress,\r\n            ipfsHash: _ipfsHash\r\n        });\r\n\r\n        developers[_userAddress] = newDeveloper;\r\n\r\n        // Update the list of addresses for the Developer role\r\n        roleToAddresses[Role.Developer].push(_userAddress);\r\n        emit RoleListUpdated(Role.Developer, roleToAddresses[Role.Developer]);\r\n\r\n        emit UserAdded(Role.Developer, _userAddress, _id, _name, _ipfsHash, \"\");\r\n    }\r\n\r\n    function addTester(string memory _id, string memory _name, address _userAddress, string memory _ipfsHash, string memory _result) external onlyRole(Role.Tester) {\r\n        require(bytes(testers[_userAddress].id).length == 0, \"Tester already exists\");\r\n\r\n        TesterInfo memory newTester = TesterInfo({\r\n            id: _id,\r\n            name: _name,\r\n            userAddress: _userAddress,\r\n            ipfsHash: _ipfsHash,\r\n            result: _result\r\n        });\r\n\r\n        testers[_userAddress] = newTester;\r\n\r\n        // Update the list of addresses for the Tester role\r\n        roleToAddresses[Role.Tester].push(_userAddress);\r\n        emit RoleListUpdated(Role.Tester, roleToAddresses[Role.Tester]);\r\n\r\n        emit UserAdded(Role.Tester, _userAddress, _id, _name, _ipfsHash, _result);\r\n    }\r\n\r\n    function addReviewer(string memory _id, string memory _name, address _userAddress, string memory _ipfsHash, string memory _result) external onlyRole(Role.Reviewer) {\r\n        require(bytes(reviewers[_userAddress].id).length == 0, \"Reviewer already exists\");\r\n\r\n        ReviewerInfo memory newReviewer = ReviewerInfo({\r\n            id: _id,\r\n            name: _name,\r\n            userAddress: _userAddress,\r\n            ipfsHash: _ipfsHash,\r\n            result: _result\r\n        });\r\n\r\n        reviewers[_userAddress] = newReviewer;\r\n\r\n        // Update the list of addresses for the Reviewer role\r\n        roleToAddresses[Role.Reviewer].push(_userAddress);\r\n        emit RoleListUpdated(Role.Reviewer, roleToAddresses[Role.Reviewer]);\r\n\r\n        emit UserAdded(Role.Reviewer, _userAddress, _id, _name, _ipfsHash, _result);\r\n    }\r\n\r\n    function addVerifier(string memory _id, string memory _name, address _userAddress, string memory _ipfsHash, string memory _result) external onlyRole(Role.Verifier) {\r\n        require(bytes(verifiers[_userAddress].id).length == 0, \"Verifier already exists\");\r\n\r\n        VerifierInfo memory newVerifier = VerifierInfo({\r\n            id: _id,\r\n            name: _name,\r\n            userAddress: _userAddress,\r\n            ipfsHash: _ipfsHash,\r\n            result: _result\r\n        });\r\n\r\n        verifiers[_userAddress] = newVerifier;\r\n\r\n        // Update the list of addresses for the Verifier role\r\n        roleToAddresses[Role.Verifier].push(_userAddress);\r\n        emit RoleListUpdated(Role.Verifier, roleToAddresses[Role.Verifier]);\r\n\r\n        emit UserAdded(Role.Verifier, _userAddress, _id, _name, _ipfsHash, _result);\r\n    }\r\n\r\n    function addBadgingAuthority(string memory _id, string memory _name, address _userAddress, string memory _ipfsHash) external onlyRole(Role.BadgingAuthority) {\r\n        require(bytes(badgingAuthorities[_userAddress].id).length == 0, \"Badging Authority already exists\");\r\n\r\n        BadgingAuthorityInfo memory newBadgingAuthority = BadgingAuthorityInfo({\r\n            id: _id,\r\n            name: _name,\r\n            userAddress: _userAddress,\r\n            ipfsHash: _ipfsHash\r\n        });\r\n\r\n        badgingAuthorities[_userAddress] = newBadgingAuthority;\r\n\r\n        // Update the list of addresses for the Badging Authority role\r\n        roleToAddresses[Role.BadgingAuthority].push(_userAddress);\r\n        emit RoleListUpdated(Role.BadgingAuthority, roleToAddresses[Role.BadgingAuthority]);\r\n\r\n        emit UserAdded(Role.BadgingAuthority, _userAddress, _id, _name, _ipfsHash, \"\");\r\n    }\r\n\r\n    function getUsersByRole(Role _role) external view returns (address[] memory) {\r\n        return roleToAddresses[_role];\r\n    }\r\n\r\n    function getUserInfo(Role _role, address _user) external view returns (string memory, string memory, address, string memory, string memory) {\r\n        if (_role == Role.Developer) {\r\n            DeveloperInfo memory devInfo = developers[_user];\r\n            return (devInfo.id, devInfo.name, devInfo.userAddress, devInfo.ipfsHash, \"\");\r\n        } else if (_role == Role.Tester) {\r\n            TesterInfo memory testerInfo = testers[_user];\r\n            return (testerInfo.id, testerInfo.name, testerInfo.userAddress, testerInfo.ipfsHash, testerInfo.result);\r\n        } else if (_role == Role.Reviewer) {\r\n            ReviewerInfo memory reviewerInfo = reviewers[_user];\r\n            return (reviewerInfo.id, reviewerInfo.name, reviewerInfo.userAddress, reviewerInfo.ipfsHash, reviewerInfo.result);\r\n        } else if (_role == Role.Verifier) {\r\n            VerifierInfo memory verifierInfo = verifiers[_user];\r\n            return (verifierInfo.id, verifierInfo.name, verifierInfo.userAddress, verifierInfo.ipfsHash, verifierInfo.result);\r\n        } else if (_role == Role.BadgingAuthority) {\r\n            BadgingAuthorityInfo memory badgingAuthorityInfo = badgingAuthorities[_user];\r\n            return (badgingAuthorityInfo.id, badgingAuthorityInfo.name, badgingAuthorityInfo.userAddress, badgingAuthorityInfo.ipfsHash, \"\");\r\n        } else {\r\n            revert(\"Invalid role specified\");\r\n        }\r\n    }\r\n}\r\n",
